import React from "react";


export default function Pagination({DogPerPage, allDogs, paging}) {
  const handlePrev = () => {
    if (DogPerPage > 1) {
      paging(DogPerPage - 1);
    }
  };

  const handleNext = () => {
    if (DogPerPage < allDogs) {
      paging(DogPerPage + 1);
    }
  };

  return (
    <div className={styles.container}>
      <button className={styles.button} onClick={handlePrev} disabled={DogPerPage === 1}>Anterior</button>
      <span className={styles.span}>{DogPerPage} de {totalPages}</span>
      <button className={styles.button} onClick={handleNext} disabled={DogPerPage === allDogs}>Siguiente</button>
    </div>
  );
};
